import React from 'react';
import styled from 'styled-components';

const SidebarFriend = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 15px;
`;

const SidebarFriendImg = styled.img`
  width: 32px;
  height: 32px;
  border-radius: 50%;
  object-fit: cover;
  margin-right: 10px;
`;

export default function CloseFriend({ user }) {
  return (
    <SidebarFriend>
      <SidebarFriendImg src={user.profilePicture} alt="" />
      <span>{user.username}</span>
    </SidebarFriend>
  );
}
